@lamplighterinnlondon 🌴
We had such an amazing time at Best Western Plus Lamplighter Inn. Located in London, ON. My girls enjoyed the pool. My favourite was the hot tub and hubby seemed to enjoy the water slide the most! 😁 The hotel was clean, service was great and staff was super friendly! We’re definitely going to be making this a family tradition. Honestly felt like we were at a resort 🌴☀️

