Have you shopped for Eid yet?
@shopstc x @runtheworldsummit present to you the Eid Souk Market where you can drop by and get all your Eid shopping done. There’s tons of fun vendors from Eid decor to modest wear, a fragrance bar, jewelry, hand poured candles, and even henna art! Come check out the Eid Souk Market and support local businesses until April 16 during store hours located at the Centre Court. 

